        return ( 
       <Form>
         <FormGroup>
         <Form.Label>Email address</Form.Label>
        <FormControl type="email" placeholder="Enter email" />
        <FormText className="text-muted">
          We'll never share your email with anyone else.
        </FormText>
         </FormGroup>
       </Form>
         );
    }
}
